import TextField from '@material-ui/core/TextField';
import {useField} from "formik";

function CustomTextField(props) {
    const [field, meta] = useField(props.name);

    return (
        <TextField
            {...field}
            {...meta}
            {...props}
        />
    );
}

export default CustomTextField;
